import React from 'react'
import "./Case.css"
import { useSelector } from 'react-redux'
function Cart() {
  const cart = useSelector(state=>state.cart)
  return (
    <div className='car-container'>
      <h2>Shopping Cart</h2>
        {cart.cartItems.length}
    </div>
  )
}

export default Cart
